import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div className="App">
      <NavigationBar></NavigationBar>
      <Banner></Banner>
      <Features></Features>
      <Benefit></Benefit>
      <Client></Client>
      <Howitsworks></Howitsworks>
      <CaseStudy></CaseStudy>
      <ClientTestimonials></ClientTestimonials>
      <Contact></Contact>
      <Footer></Footer>
    </div>
  );
}

export default App;
